import React from 'react';
import './App.css';
import Page1 from './components/Page1';

export default class App extends React.Component {
  render() {
    return (
      <div class="navbar">
        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">About me</a></li>
          <li><a href="#">Skills</a></li>
          <li><a href="#">Projects</a></li>
        </ul>
      </div>
    );
  }
}
